import {makeStyles} from "@material-ui/core";
import "./NavButton.css";

function NavButton(props){
    const [active,setActive] = useState(false);

    return(
        <button className = {active ? "nav-button" : "nav-button active"}>
            {props.text}
        </button>
    );
}

export default NavButton;
